import '../styles/globals.css'
import { motion, AnimatePresence } from "framer-motion"
import Tilt from 'react-tilt'

import withDarkMode from 'next-dark-mode'
import { useDarkMode } from 'next-dark-mode'

function main ({ Component, pageProps, router }) {
  const {
	autoModeActive,
	autoModeSupported,
	darkModeActive,
	switchToAutoMode,
	switchToDarkMode,
	switchToLightMode,
  } = useDarkMode()

  return (
  	<AnimatePresence>
  		<motion.div 
	  		key={router.route} 
	  		initial="pageInitial" 
	  		animate="pageAnimate" 
	  		exit="pageExit" 
	  		transition={{ default: { duration: .5 } }}
	  		variants={{
				pageInitial: {
					opacity: 0
				},
				pageAnimate: {
					opacity: 1
				},
				pageExit: {
					opacity: 0
				}
			}}
		>
  			<Component {...pageProps} />
  		</motion.div>
  	</AnimatePresence>
  )
}


export default withDarkMode(main)
